import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Example from './DataGrid/stock-dg'
import DenseAppBar from './ApplicationBar/AppBar';

class App extends Component {
  render() {
    return (
      <div>
      <DenseAppBar />
      <Example />
      </div>
    );
  }
}

export default App;
